function Equipment({ equipment }) {
  return (
    <div className="equipWrapper">
      <Dropdown title={title} content={equipment} />
    </div>
  );
}

Equipment.propTypes = {
  equipment: PropTypes.array.isRequired,
};

export default Equipment;

